import React from 'react';

class TodoList extends React.Component {
  render() {
    return (
      <div>
        <div>
          <input />
          <button />
        </div>
        <ul>
          <li>learn react</li>
          <li>learn English</li>
        </ul>
      </div>
    );
  }
}

export default TodoList;
